import React from "react";
import hero from "../img/hero.png";
const Hero = () => {
  return (
    <div className="Hero-container">
      <div className="hero-image">
        <img src={hero} />
      </div>
      <div className="hero-description"></div>
    </div>
  );
};

export default Hero;
